                    id="reporterNo"
                    label={<div style={{ fontSize: 13, float: 'left' }}>* 项目名称/机构编号</div>}
                    defaultValue="压力测试号"
                />
                <TextField
                    {...register("reporterNo",
                        { required: true })}
                    required
                    style={{ ...{ width: "30%" }, ...{ marginBottom: 10, paddingRight: 10 } }}
                    color="secondary"
                    id="reporterNo"
                    label={<div style={{ fontSize: 13, float: 'left' }}>* 报告者识别号</div>}
                    defaultValue="yuanqiao"
                />
                <TextField
                    {...register("orgAddress",
                        { required: true })}
                    required
                    style={{ ...{ width: "30%" }, ...{ marginBottom: 10, paddingRight: 10 } }}
